import React, { useRef } from "react";

const Button = ({ onSearch }) => {
  // const inputRef = useRef();
  // const onKeyPress = () => {
  //   handleSearch();
  // };

  const handleSearch = (e) => {
    const count = e.target.value;
    onSearch(count);
  };

  return (
    <>
      <h1>Youtube</h1>
      <input
        // ref={inputRef}
        type="search"
        placeholder="Search..."
        onKeyPress={handleSearch}
      />
    </>
  );
};

export default Button;
